  "qa1_a": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": "Is the website free?" } },
  "qa1_q1": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": "Not completely free. For long-term development, future charges are inevitable, but it will not require payment to use. We try to find a balance between free and paid." } },
  "qa1_q2": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": "The project is open source, you can deploy it yourself." } },
  "qa2_a": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": "Cannot type, keyboard has no response?" } },
  "qa3_a": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": "Where is the data? How to use across multiple computers/devices?" } },
  "qa3_q1": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": "All user data is saved in the local browser. If you need to use Type Words on different devices or browsers, you need to manually export and import data." } },
  "qa3_q2": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": "Settings -> Data Settings -> Export data on original computer -> Send to new computer via social software -> Import on new computer" } },
  "qa3_q3": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": "Account system is under development." } },
  "qa4_a": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": "The website plans too many words automatically, how to modify?" } },
  "qa4_q1": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": "The default ratio of review words to new words is 1:4. If there are 40 new words, it will review 40 words from the last session and 120 words from previous sessions." } },
  "qa4_q2": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": "You can modify it via Settings -> Word Settings -> Review Ratio" } },
  "qa5_a": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": "It takes too long to complete one learning session, is the process too lengthy?" } },
  "qa5_q1": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": "This is indeed an issue. A lengthy process can easily make people lose motivation. I am thinking about how to optimize the learning process." } },
  "qa5_q2": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": "Wrong words will be repeated. If it was just a typo, you can press Tab to skip during subsequent practice." } },
  "qa5_q3": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": `During review, only words marked as "don't know" require dictation and spelling.` } },
  "qa5_q4": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": "After the account system is launched, the Ebbinghaus memory curve feature will be added." } },
  "qa6_a": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": "Will the Ebbinghaus memory curve feature be added?" } },
  "qa7_a": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": "Can I add words/custom dictionaries/import my own words/modify word content?" } },
  "qa7_q1": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": 'Yes, on the Words page, click "Create Personal Dictionary"' } },
  "qa7_q2": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": 'After creation, on the dictionary details page, click the "Add Word" icon to add your own words' } },
  "qa7_q3": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": 'You can also click the "Import" icon to batch import (must strictly follow the template xlsx format)' } },
  "qa8_a": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": "Can I add articles/custom books/import my own articles/modify article content?" } },
  "qa8_q1": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": "Yes, the steps are basically the same as adding words" } },
  "qa8_q2": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": 'On the Articles page, click "Create Personal Book"' } },
  "qa8_q3": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": 'After creation, click the "Article Management" button at the top to add your own articles' } },
  "qa9_a": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": "How to turn off key sounds?" } },
  "qa9_q": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": "Settings -> General Settings -> Sound Effects -> Key Sound, turn it off" } },
  "qa10_a": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": "Can I use it on a tablet?" } },
  "qa10_q1": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": "Tablets can be used, but using a Bluetooth keyboard provides a better experience since the built-in virtual keyboard takes up 1/3 of the screen space." } },
  "qa10_q2": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": 'After connecting a Bluetooth keyboard, Android tablets need to manually enable "Desktop Mode" in the browser; iPad does not need this operation.' } },
  "qa11_a": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": "Can I use it on a phone?" } },
  "qa11_q": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": "Phones can be used, but optimization for phones has not been done yet. It is recommended to use on a computer or tablet." } },
  "qa12_a": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": "Is there an APP or mini-program?" } },
  "qa12_q": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": "No, only the website" } },
