  "qa13_q1": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": "You can join our official WeChat group, describe in detail the features you want" } },
  "qa13_q2": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": "If you find bugs in the application, please provide a detailed description and steps to reproduce, preferably with a short video" } },
  "qa13_q3": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": "You can also submit a support ticket to us" } },
